import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Notes = () => {
  const [showForm, setShowForm] = useState(false);
  const [title, setTitle] = useState('');
  const [content, setContent] = useState('');
  const [notes, setNotes] = useState([]);

  const fetchNotes = async () => {
    try {
      const token = localStorage.getItem('token');
      const res = await axios.get('http://localhost:5000/api/notes', {
        headers: { Authorization: `Bearer ${token}` }
      });
      if (res.data.success) setNotes(res.data.notes);
    } catch (err) {
      console.error(err);
    }
  };

  useEffect(() => {
    fetchNotes();
  }, []);

  const handleAddNote = async (e) => {
    e.preventDefault();
    const token = localStorage.getItem('token');

    try {
      const res = await axios.post('http://localhost:5000/api/notes', { title, content }, {
        headers: { Authorization: `Bearer ${token}` }
      });
      if (res.data.success) {
        setTitle('');
        setContent('');
        setShowForm(false);
        fetchNotes();
      }
    } catch (err) {
      console.error(err);
    }
  };

  const handleDelete = async (id) => {
    const token = localStorage.getItem('token');
    try {
      await axios.delete(`http://localhost:5000/api/notes/${id}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      fetchNotes();
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <div style={{ padding: '2rem', fontFamily: 'sans-serif', background: '#f1f1f1', minHeight: '100vh' }}>
      <h1 style={{ textAlign: 'center', color: '#f5ba13' }}>Keeper</h1>

      {showForm && (
        <form onSubmit={handleAddNote} style={{
          background: 'white',
          padding: '1rem',
          borderRadius: '7px',
          boxShadow: '0 2px 5px #ccc',
          maxWidth: '500px',
          margin: '20px auto',
          position: 'relative'
        }}>
          <input
            type="text"
            placeholder="Title"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            style={{ width: '100%', border: 'none', outline: 'none', fontSize: '1.2em' }}
            required
          />
          <textarea
            placeholder="Take a note..."
            value={content}
            onChange={(e) => setContent(e.target.value)}
            rows="3"
            style={{ width: '100%', border: 'none', outline: 'none', resize: 'none' }}
            required
          />
          <button type="submit"
            style={{
              background: '#f5ba13',
              border: 'none',
              borderRadius: '50%',
              width: '40px',
              height: '40px',
              fontWeight: 'bold',
              color: 'white',
              position: 'absolute',
              bottom: '-20px',
              right: '20px',
              cursor: 'pointer'
            }}
          >Add</button>
        </form>
      )}

      <button onClick={() => setShowForm(!showForm)} style={{
        background: '#f5ba13',
        color: 'white',
        border: 'none',
        borderRadius: '50%',
        width: '60px',
        height: '60px',
        fontSize: '2rem',
        fontWeight: 'bold',
        position: 'fixed',
        bottom: '30px',
        right: '30px',
        cursor: 'pointer'
      }}>
        {showForm ? '×' : '+'}
      </button>

      <div style={{
        display: 'flex',
        flexWrap: 'wrap',
        justifyContent: 'center',
        gap: '1rem',
        marginTop: '2rem'
      }}>
        {notes.map(note => (
          <div key={note._id} style={{
            background: 'white',
            padding: '1rem',
            borderRadius: '7px',
            boxShadow: '0 2px 5px #ccc',
            width: '250px',
            position: 'relative'
          }}>
            <h4 style={{ margin: '0 0 10px 0' }}>{note.title}</h4>
            <p style={{ margin: 0 }}>{note.content}</p>
            <button onClick={() => handleDelete(note._id)} style={{
              position: 'absolute',
              bottom: '10px',
              right: '10px',
              background: 'none',
              color: '#f5ba13',
              border: 'none',
              cursor: 'pointer'
            }}>DELETE</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Notes;
